import styled from 'styled-components';
import logo from '../../static/logo.png;'
export const HeaderWrap=styled.div`
	position:relative;
	top:0px;
	left:50%;
	margin-left:-50%;
	width:100%;
	height:60px;
	background-color:#f0f0f0;
	border-bottom:1px solid #eee;
`;
export const Logo=styled.a`
	position:absolute;
	top:0px;
	left:0px;
	display:block;
	width:100%;
	height:60px;
	background:url(${logo})
`;
